import React, { Component } from 'react'
import { Card, CardHeader, CardBody, Button } from 'reactstrap'
import Question from './../../../components/Card/Question'

class Vragenlijstv2 extends Component {

    constructor(props) {
        super(props)
        this.state = {
            questions: [{
                questionID: 1,
                question: 'Vraag1?'
            },
            {
                questionID: 2,
                question: 'Vraag2?'
            },
            {
                questionID: 3,
                question: 'Vraag1?'
            },
            {
                questionID: 4,
                question: 'Vraag4?'
            }]
        }
    }

    saveQuestions() {
        const question0 = document.querySelector('input[name=question0]:checked').value
        const question1 = document.querySelector('input[name=question1]:checked').value

        alert(question0 + '-----' + question1)
    }

    render() {
        const { questions } = this.state
        return (
            <div className="animated fadeIn">
                <div className="vragenlijstv2">
                    <Card>
                        <CardHeader>
                            Vragenlijstv2
                        </CardHeader>
                        <CardBody>
                            <div className="question">
                                <input type="radio" className="question0" name="question0" value="1" />
                                <input type="radio" className="question0" name="question0" value="2" />
                                <input type="radio" className="question0" name="question0" value="3" />
                                <input type="radio" className="question0" name="question0" value="4" />
                                <input type="radio" className="question0" name="question0" value="5" />
                            </div>
                            <Question questions={questions}/>
                            <div className="save-questions">
                                <Button onClick={() => { this.saveQuestions() }}>Vragenlijst Opslaan</Button>
                            </div>

                        </CardBody>
                    </Card>
                </div>
            </div>
        )
    }
}

export default Vragenlijstv2
